import React from "react";

import "./Style.css";


function BookCard({ title, author, description, url }) {
  return (
    <div className="repo">
      <p>Título: {title}</p>
      <p>por {author}</p>
      <p>{description}</p>
      <p>{url}</p>
    </div>
  );
}

export default BookCard;
